import React, { Component } from "react";
import { Link } from "react-scroll";
import logo from '../img/logo-colored.png';

class Nav extends Component {
    state = {};
    render() {
        return (
            <div className="navbar">

                <div className="block-one">
                    <img src={logo} className="icon" alt="Logo" onClick={this.scrollToTop} />
                </div>
    

                <Link activeClass="active"  to="First" spy={true} smooth={true}  offset={-70}  duration={500} >ПЕРВЫЙ ЭКРАН</Link>
                <Link activeClass="active"  to="Entry" spy={true} smooth={true}  offset={-70}  duration={500} >ВСТУПЛЕНИЕ</Link>
                <Link activeClass="active"  to="Infographics" spy={true} smooth={true}  offset={-70}  duration={500} >ИНФОГРАФИКА</Link>
                <Link activeClass="active"  to="" spy={true} smooth={true}  offset={-70}  duration={500} >ПРОИЗВОДИТЕЛЬНОСТЬ</Link>
                <Link activeClass="active"  to="" spy={true} smooth={true}  offset={-70}  duration={500} ></Link>
           
            </div>
        )
    }
}

export default Nav;
